$C = New-Object System.Net.WebClient
$P = (pwd).path
Function d($uri, $dir, $file) {
    $script:count ++
    $target = $dir + '/' + $file
    $dirpath = $P + '/' + $dir
    $filepath = $dirpath + '/' + $file
    echo ("({0,4}/${total}) ${target}" -f $count)
    mkdir -f $dirpath | Out-Null
    $C.DownloadFile($uri, $filepath)
}
